import React, { Component } from 'react'
//import L2 from './l2';
class L1 extends Component {
    constructor(props){
        super(props);
        this.state = {
          data: [{name: 'bob',age:'21'}, {name: 'chris',age:'22'}],
        };
    }
  render() {
    return (
      <ul>
        {this.state.data.map(d => <li key={d.name}>{d.name}</li>)}
      </ul>
    );
  }
}
export default L1;
